import Link from 'next/link'

const linkStyle = {
  marginRight: 15
}
const services_array = ["Solutions", "Projects", "Gear", "Music", "Contact"];
export default function Header() {
  return (

    <nav className="navbar fixed-top navbar-expand-lg toggle-height" id="global-nav">
    <link rel="stylesheet" type="text/css" href="/static/nav.css"/>

        <div className="container">
      <Link href="/">
        <a className="navbar-brand scrollN">Prabhakar Mishra</a>
      </Link>
      <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span class="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarSupportedContent">
          {services_array.map(service => (
            <Link href={`/${service}`}>
                <a className="nav-link scrollN">{service}</a>
            </Link>
          ))}
      </div>
        </div>
    </nav>

  )
}
